import { useState } from "react";

const Item = (props) => {

    const [checked, setChecked] = useState(false);
    console.log(checked);
    return (
        <form action="">
            <input type="checkbox" name="" id="" onChange={() => setChecked(checked)} />
            <label style={{ textDecoration: checked ? "none" : "line-through", color: checked ? "darkblue" : "lightblue" }}>{props.task}</label>
        </form>
    );
}

export default Item;
